import React from "react";
import ImageToggleOnScroll from "../src/ImageToggleOnScroll";

const ImageChangeOnScroll = () => {
    return (
        <div>

                        <ImageToggleOnScroll
                            primaryImg={`/static/1.jpg`}
                            secondaryImg={`/static/black_white/2.jpg`}
                            alt=""
                        />
           
        </div>
    );
};

export default ImageChangeOnScroll;
